import logo from '../../logo.svg';
function Header() {
    const logotipo = <img src={logo} width="70px" />;

    return (
        <div className="row m-3">
            <div className="col"> 
                <p className="fs-1 fw-bold mytitle">{logotipo} MyBook</p>
            </div>
            <div className="col">
                <ul className="nav justify-content-end">
                    <li className="nav-item">
                        <a href="#" className="nav-link">Sobre</a>
                    </li>
                    <li className="nav-item">
                        <a href="#" className="nav-link">Lista de Livros</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link">Cadastrar</a>
                    </li>
                </ul>
            </div>
        </div>
    );
}
export default Header;
